import React from 'react';
import './SignButton.css';

function SignButton(props) {

    return (
        props.withIcon ?
            <div className='SignButton'>
                <img src = {props.icon}/>
                {props.message}
            </div>
        :
        <div className='SignButton-Email'>
            {props.message}
        </div>

    )
}

export default SignButton
